import React from "react";
import './Header.css';
import { NavLink } from "react-router-dom";
import { useNavigate } from "react-router-dom";


function Header() {
    return (
        <header class="header">
    <nav class="navbar navbar-expand-lg fixed-top py-3">
        <div class="container"><a href="#" class="navbar-brand text-uppercase font-weight-bold">Transparent Nav</a>
            <button type="button" data-toggle="collapse" data-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation" class="navbar-toggler navbar-toggler-right"><i class="fa fa-bars"></i></button>

            <div id="navbarSupportedContent" class="collapse navbar-collapse">
                <ul class="navbar-nav ml-auto">
                <li class="nav-item active">
                    <NavLink to='/'><a class="nav-link" href="#">Home</a></NavLink>
                    </li>
                    <li class="nav-item">
                    <NavLink to='/onehash'><a class="nav-link" href="#">OneHash</a></NavLink>
                    </li>
                    <li class="nav-item">
                    <NavLink to='/'><a class="nav-link" href="#">SeveralH</a></NavLink>
                    </li>
                    <li class="nav-item">
                    <NavLink to='/statistiques'><a class="nav-link" href="#">Statistiques</a></NavLink>
                    </li>
                </ul>
            </div>
        </div>
    </nav>
</header>
);
}

export default Header;
